import React from 'react';
import styeld from 'styled-components';
import { Spinner } from 'react-bootstrap';

const Loading = () => {
  return (
    <div>
      <Spinner animation='border' variant='success' />
      <div>조금만 기다려주세요</div>
    </div>
  );
};

export default Loading;
